  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Nunivak
  National Wildlife Refuge outlines Refuge accomplishments during the 1970-1971 calendar
  year.  The report begins by summarizing the weather conditions and habitat conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, rodents, mammals, raptors, fish, and diseases- is
  also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. Resource management is outlined; topics include grazing.
  A progress report on field investigations and applied research is also provided.
  Items of interest and N-R forms are attached\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
